import React, { Component } from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import {
    Button,
    Card
  } from "react-bootstrap";
import "../css/modes.css"



class Modes extends Component {
    render() {
        return(
            <div className="modes-page">
                <a href = ""/>
                <div className="button-container">
                    <div className="dynamic-button-inner">
                        <div className="dynamic-button-front">
                            <img className="dynamic-button" src={require("../images/dynamic.jpg")} alt="Dynamic Picture" />
                        </div>
                        <div className="dynamic-button-back">
                            <p> Description for dynamic</p>
                        </div>
                    </div>
                    <div className="playlist-button-inner">
                        <div className="playlist-button-front">
                            <img className="playlist-button" src={require("../images/dynamic.jpg")} alt="Dynamic Picture" />
                        </div>
                        <div className="playlist-button-back">
                            <p> Description for playlist</p>
                        </div>
                    </div>
                </div>

            </div>
        )
    }
}

export default Modes
